import Link from 'next/link';

const divStyle = {
  paddingBottom: 10,
}
const linkStyle = {
  marginRight: 20,
};
const logoStyle = {
  marginLeft: 17,
  margintop: 10,
  width: 80
};
const Header = () => (
  <div style={divStyle}>

    <Link href="/">
      <a style={linkStyle}> <img style={logoStyle} src="../static/logo.png"/></a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/feature">
      <a style={linkStyle}>Feature</a>
    </Link>
    <Link href="/amazon">
      <a style={linkStyle}>Amazon</a>
    </Link>
  </div>

);

export default Header;
